import React, { useEffect, useState } from 'react';
import {useForm} from 'react-hook-form';
import axios from 'axios';
import { API_URL } from '../../constants';

const FormUpdate = ({selectedEntry, setSelectedEntry, refreshList}) => {
    const [formData, setFormData] = useState({ //adding state to the functional component through useState React Hook
        id: 0,
        name: '',
        email: '',
        select: '',
        shirtOption: '',
        raceOption: '',
        comments: '',
    });

    useEffect(() => {
        if(selectedEntry) {
            setFormData({
                id: selectedEntry.id,
                name: selectedEntry.name,
                email: selectedEntry.email,
                select: selectedEntry.select,
                raceOption: selectedEntry.raceOption,
                comments: selectedEntry.comments
            })
        }
    }, [selectedEntry]);

   //using components of the useForm react hook to validate the inputs of the form
   const {
    register, 
    handleSubmit,
    formState: {errors},
    reset,
} = useForm();
    

    //creating the onSubmit function to submit the form to the backend
    const onSubmit = (formData) => {
        formData.preventDefault();
            //using axios to call to the backend to create or post a new entry
            axios.post(API_URL, formData) 
                .then((response) => {
                    //logging the data to the console 
                    console.log(response.data); 
                    reset();
                    refreshList();
                    alert('Form submitted successfully');
                })
                .catch((error) => {
                    console.error(error);
                    alert('An error occurred. Please try again.')
                });
        
    };

    const handleUpdate = () => {
        setSelectedEntry(null);
    };

    return(
        <form className='form' onSubmit={handleSubmit}>
            <div className='formField'>
                <label className='label'>Name: </label>
                <input className='input' type='text'value={formData.name} onChange={handleChange} ></input>
                
            </div>
            <div className='formField'>
                <label className='label'>Email: </label>
                <input className='input'type='text' value={formData.email} onChange={handleChange}></input>
                
            </div>
            <div className='formField'>
                <label className='label'>Select: </label>
                <select value={formData.select} name="select" onChange={handleChange}>
                    <option value=''>Do you want your name on your bib?</option>
                    <option value='Yes'>Yes</option>
                    <option value='No'>No</option>
                </select>
                
            </div>
            <div className='formField'>
            <label className='label'>Choose a Race: </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="5k"
                        checked={formData.raceOption === "5k"}
                        
                    />
                    5k
                </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="Half-Marathon"
                        checked={formData.raceOption === "Half-Marathon"}

                    />
                    Half-Marathon
                </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="Marathon"
                        checked={formData.raceOption === "Marathon"}
                    />
                    Marathon
                </label>
                
            </div>
            <div className='formField'>
                <label className='label'>Comments: </label>
                <textarea className='text-area' name="comments" type='text' value={formData.comments} onChange={handleChange}></textarea>
                
            </div>
            <button className='submitButton' type='submit'>Submit</button>
        </form>
    )

}

export default FormUpdate;
